export class Coupon {
  constructor(id, title, value, description, couponNr, used, user, event) {
    this.id = id;
    this.title = title;
    this.value = value;
    this.description = description;
    this.couponNr = couponNr;
    this.used = used;
    this.user = user;
    this.event = event;
    this.used = this.used ?? false;
  }
}
export function getCouponIdentifier(coupon) {
  return coupon.id;
}
